{
  "assistant": {
    "name": "Lisa",
    "voice": {
        "voiceId": "en-AU-KimNeural",
        "provider": "azure"
    },
    "model": {
        "model": "gpt-3.5-turbo",
        "messages": [
            {
                "role": "system",
                "content": "You are a voice assistant for Healthy Wrap, a vibrant restaurant located at 456 Green Leaf Boulevard, Portland, Oregon. The hours are from 11 AM to 11 PM daily, but they are closed on Mondays. The current date and time is: {{formatDate(now; "YYYY-MM-DD HH:mm:ss")}}\n\nHealthy Wrap specializes in offering nutritious and delicious wraps and salads to the Portland community.\n\nYour job involves answering queries about the restaurant and assisting callers with table reservations. When a caller wants to reserve a table, your goal is to gather the necessary information in a friendly and efficient way as follows:\n\nAsk for the caller's first name.\nInquire about the date and time they’d like to reserve a table for.\nCheck if the reservation is for a special occasion.\nAim to keep the conversation light-hearted and engaging!\nUse concise and informal language, with phrases like \"Oh, by the way,\" \"Gotcha,\" and \"Alrighty\".\nSince this is a voice interaction, keep your responses brief and conversational. Avoid overly lengthy explanations."
            }
        ],
        "provider": "openai",
        "functions": [
          {
            "name": "ReserveTable",
            "async": false,
            "description": "Reserves a table for a given number of guests at a specific date and time.",
            "parameters": {
              "type": "object",
              "properties": {
                "date_and_time": {
                  "type": "string",
                  "description": "The date and time of the table reservation"
                },
                "guest_number": {
                  "type": "integer",
                  "description": "The number of guests"
                },
                "special_occasion": {
                  "type": "string",
                  "description": "Any special occasion if given."
                }
              },
              "required": [
                "date_and_time",
                "guest_number"
              ]
            },
            "serverUrl": "WEBHOOK_ENDPOINT",
            "serverUrlSecret": "12345"
          }
        ],
        "maxTokens": 250,
        "temperature": 1
    },
    "recordingEnabled": false,
    "firstMessage": "Hello {{3.`0`}}, this is Lisa from Healthy Wrap, how can I assist you?",
    "voicemailMessage": "You've reached Healthy Wrap voicemail. Please leave a message after the beep, and we'll get back to you as soon as possible.",
    "endCallFunctionEnabled": true,
    "endCallMessage": "Thank you for contacting Healthy Wrap. Have a great day!",
    "transcriber": {
        "model": "nova-2",
        "language": "en",
        "provider": "deepgram"
    },
    "clientMessages": [
        "transcript",
        "hang",
        "function-call",
        "speech-update",
        "metadata",
        "conversation-update"
    ],
    "serverMessages": [
        "end-of-call-report",
        "function-call"
    ],
    "dialKeypadFunctionEnabled": false,
    "endCallPhrases": [
        "goodbye",
        "talk to you soon"
    ],
    "hipaaEnabled": false,
    "backgroundSound": "off",
    "serverUrl": "WEBHOOK_ENDPOINT",
    "serverUrlSecret": "12345"
}
}

